function App() {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
     fetch('http://127.0.0.1:8000/heroes/?format=api', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json'
      }
     })
        .then((response) => response.json())
        .then((data) => {
           console.log(data);
           setPosts(data);
        })
        .catch((err) => {
           console.log(err.message);
        });
  }, []);

return (
  <Incentives posts={posts}/>
);
};

export default App;
